import React from 'react'
import { Navbar } from 'react-bootstrap'

const Header = () => {
    return (
        <div>
              <style type="text/css">
    {`
    .navbar-flat {
      background-color: purple;
      color: white;
    }


    `}
  </style>

            <Navbar bg="light" variant="flat">
    <Navbar.Brand href="#home">
      <img
        alt=""
        src="/logo.svg"
        width="30"
        height="30"
        className="d-inline-block align-top"
      />
      {'HAVVKA'}
    </Navbar.Brand>
  </Navbar>

        </div>
    );
}

export default Header;
